* {margin: 0; padding: 0;}
li {list-style: none;}
a {color: black; text-decoration: none;}
img {display: block;}



/*----------float_banner-------------*/

.aside_ad_right {
    width: 150px;
    height: 2100px;

    position: absolute;
    top: 273px;
    right: 307px;
}


#float01, #float02, #float03 {display: none;}

#float01:checked ~ .floatimg01 {display: block;}
#float02:checked ~ .floatimg02 {display: block;}
#float03:checked ~ .floatimg03 {display: block;}

#float01:checked ~ .float_label .float01 i {color: firebrick;}
#float02:checked ~ .float_label .float02 i {color: firebrick;}
#float03:checked ~ .float_label .float03 i {color: firebrick;}

.aside_ad_right .float_banner .float_box>div:nth-child(2) .flo {display: none;}
.aside_ad_right .float_banner .float_box>div:nth-child(2) .flo {
    width: 100px;
    height: 80px;
    line-height: 80px;
    text-align: center;
}
.aside_ad_right .float_banner {
    width: 100px;
    height: 580px;
    margin-left: 26px;

    position: sticky;
    top: 40px;
}
.aside_ad_right .float_banner .float_box {
    width: 100px;
    height: 367px;
    border: 1px solid #ccc;
    border-radius: 10px;
}
.aside_ad_right .float_banner .float_box>div:first-child {
    width: 100px;
    height: 35px;
    line-height: 40px;
    background-color: #eee;
    border-radius: 10px 10px 0 0;
    font-size: 13px;
    text-align: center;
}
.aside_ad_right .float_banner .float_box>div:first-child>a {
    color: #333;
}
.aside_ad_right .float_banner .float_box>div:nth-child(2) {
    width: 100px;
    height: 80px;
    position: relative;
}
.aside_ad_right .float_banner .float_box>div:nth-child(2)>div {
    width: 100px;
    height: 80px;
}
.aside_ad_right .float_banner .float_box>div:nth-child(2)>div img {
    width: 100px;
    height: 80px;
    float: left;
}
.aside_ad_right .float_banner .float_box>div:nth-child(2) .float_label {
    width: 80px;
    height: 10px;

    position: absolute;
    left: 20px;
    bottom: 7px;
}
.aside_ad_right .float_banner .float_box>div:nth-child(2) .float_label label i {
    font-size: 5px;
    float: left;
    padding-left: 7px;
    color: rgba(0, 0, 0, 0.3);
}
.aside_ad_right .float_banner .float_box>p {
    width: 100px;
    height: 32px;
    line-height: 32px;
    text-align: center;
    font-size: 14px;
    background-color: #eee;
    color: #333;
}
.aside_ad_right .float_banner .float_box>div:nth-child(4) {
    width: 100px;
    height: 220px;
    background-color: white;
    border-radius: 0 0 10px 10px;
}
.aside_ad_right .float_banner>div:last-child {
    width: 100px;
    height: 140px;
    margin-top: 10px;
    border: 1px solid #ccc;
    border-radius: 10px;
    background-color: white;
}
.aside_ad_right .float_banner>div:last-child>a>img {
    width: 80px;
    height: 120px;
    border-radius: 10px;
    margin: 10px 10px;
    border: 1px solid #eee;
    box-sizing: border-box;
}





/*----------top_ad-------------*/
#chk_ad {display: none;}
#chk_ad:checked ~ .top_ad {display: block;}
#chk_ad ~ .top_ad {display: none;}

.top_ad {
    width: 100%;
    height: 60px;
    background-color: #F8F0DB;
}
.top_ad .top_ad_img {
    width: 950px;
    height: 60px;
    margin: 0 auto;
}
.top_ad .top_ad_img>a {
    width: 950px;
    height: 60px;
}
.top_ad .top_ad_img>a>img {
    width: 950px;
    height: 60px;
}
.top_ad .top_ad_label {
    width: 30px;
    height: 30px;

    position: absolute;
    top: 16px;
    right: 480px;
}
.top_ad .top_ad_label img {
    width: 28px;
    height: 28px;
}
.top_ad .top_ad_label img:hover {
    cursor: pointer;
}


/*----------top-----------*/
.top {
    width: 50px;
    height: 50px;

    position: fixed;
    right: 70px;
    bottom: 25px;

    z-index: 5;
}
.top a i {
    font-size: 50px;
    color: rgba(0, 0, 0, 0.1);
    background-color: white;
    width: 50px;
    height: 50px;
    border-radius: 25px;
}



/*----------header-----------*/
#mob, #mob_t_home, #mob_t_domestic, #mob_t_foreign, #mob_t_new, #mob_t_ebook,   #mob_t_theme, #mob_t_member,
#new_literature, #new_humanities, #new_economy, #new_language {display: none;}
.open, .mob_icon, .mob_search_box, .mob_lnb_box, .allmenu_sub, .sub_tab_box,
.mob_rankinnewbook_box, .ad_box, .new_view, .mob_service_box  {display: none;}

.header_box {
    width: 950px;
    height: 140px;
    margin: 0 auto;
}


/*----------gnb-----------*/
.header_box .gnb {
    width: 950px;
    height: 30px;
    line-height: 30px;
}
.header_box .gnb ul {
    float: right;
}
.header_box .gnb ul li {
    display: inline-block;
    margin-left: 5px;
}
.header_box .gnb ul li:first-child {
    margin-left: 0;
}
.header_box .gnb ul li a {
    font-size: 11px;
    color: #333;
}
.header_box .gnb ul li a:hover {
    cursor: pointer;
}


.header_box .header {
    width: 950px;
    height: 100px;
}
.header_box .header .logo {
    width: 220px;
    height: 105px;

    float: left;
}
.header_box .header .logo img {
    width: 225px;
    height: 85px;
}
.header_box .header .box {
    width: 450px;
    height: 85px;
    margin-top: 10px;
    margin-left: 25px;
    float: left;
}
.header_box .header .box .ad_text {
    width: 450px;
    height: 20px;

    text-align: center;
    margin-bottom: 10px;
}
.header_box .header .box .ad_text li {
    display: inline;
}
.header_box .header .box .ad_text li:last-child a {
    border-right: 0;
}
.header_box .header .box .ad_text li a {
    font-size: 11px;
    color: #999;
    padding: 0 5px;
    border-right: 1px solid #999;
}
.header_box .header .box .ad_text li a:nth-child(3) {
    border-right: 0;
}
.header_box .header .box .search {
    width: 450px;
    height: 40px;
    line-height: 40px;
    border: 3px solid #d9211c;
    box-sizing: border-box;
    border-radius: 20px;

    position: relative;
}
.header_box .header .box .search select {
    width: 75px;
    height: 20px;
    border: none;
    background-color: rgba(0, 0, 0, 0);
    position: absolute;
    top: 8px;
    left: 13px;
}
.header_box .header .box .search i {
    font-size: 20px;
    color: #333;

    position: absolute;
    top: 7px;
    right: 15px;
}


/*----------mini_banner-----------*/
#mini01, #mini02, #mini03 {display: none;}

#mini01:checked ~ .mini_banner ul li {transform: translateX(0)}
#mini02:checked ~ .mini_banner ul li {transform: translateX(-170px)}
#mini03:checked ~ .mini_banner ul li {transform: translateX(-340px)}

.header_box .header .mini_banner {
    width: 170px;
    height: 65px;
    float: left;
    margin-left: 60px;
    margin-top: 25px;
    position: relative;
    overflow: hidden;
}
.header_box .header .mini_banner ul {
    width: 510px;
    height: 65px;
}
.header_box .header .mini_banner ul li {
    width: 170px;
    height: 65px;
    float: left;
}
.header_box .header .mini_banner ul li img {
    width: 170px;
    height: 65px;
}

.header_box .header .mini_banner label {
    display: block;
    width: 19px;
    height: 19px;
    line-height: 16px;
    text-align: center;
    border: 1px solid #ccc;
    box-sizing: border-box;
    border-radius: 3px;
    position: absolute;
    bottom: 0;
    cursor: pointer;
}
.header_box .header .mini_banner .left {
    width: 19px;
    height: 19px;
    position: absolute;
    right: 19px;
    bottom: 0;
}
.header_box .header .mini_banner .right {
    width: 19px;
    height: 19px;
    position: absolute;
    right: 0;
    bottom: 0;
}




/*----------lnb-----------*/
#chk_allmenu {display: none;}
#chk_allmenu:checked ~ .lnb .allmenu_sub {display: block;}
#chk_allmenu ~ .lnb .allmenu_sub {display: none;}

#chk_allmenu:checked ~ .lnb .chk_btn {display: block;}


.lnb_box {
    width: 100%;
    height: 43px;
    background-color: #333;
}
.lnb_box .lnb {
    width: 950px;
    height: 43px;
    margin: 0 auto;
    position: relative;
}
.lnb_box .lnb label {
    width: 100px;
    height: 43px;
    line-height: 43px;
    text-align: center;
    color: #eee;
    font-size: 15px;
    cursor: pointer;
    float: left;
}
.lnb_box .lnb label img {
    width: 20px;
    height: 20px;
    margin-top: 12px;
    margin-left: 7px;
    float: left;
}

.lnb_box .lnb .menu {
    width: 500px;
    height: 43px;
    float: left;
}
.lnb_box .lnb .menu>li{
    display: inline-block;
    line-height: 43px;
    padding-left: 25px;
}
.lnb_box .lnb .menu>li>a {
    font-size: 15px;
    color: #eee;
}
.lnb_box .lnb .side_menu {
    width: 308px;
    height: 43px;
    float: right;
}
.lnb_box .lnb .side_menu li {
    display: inline-block;
    line-height: 43px;
    padding-left: 10px;
}
.lnb_box .lnb .side_menu li:nth-child(2) {
    padding-left: 30px;
    position: relative;
}
.lnb_box .lnb .side_menu li:nth-child(2) i {
    width: 17px;
    height: 17px;
    line-height: 17px;
    text-align: center;
    font-size: 4px;
    color: yellow;
    background-color: #d9211c;
    border-radius: 3px;

    position: absolute;
    top: 13px;
    right: 48px;

    animation-name: new;
    animation-duration: 3s;
    animation-iteration-count: infinite;
}
@keyframes new {
    0% {background-color: yellow; color: #d9211c;}
    50% {background-color: #d9211c; color: yellow;}
    100% {background-color: yellow; color: #d9211c;}
}
.lnb_box .lnb .side_menu li a {
    font-size: 15px;
    color: #eee;
}

.lnb_box .allmenu_sub .login_box,
.lnb_box .allmenu_sub .totaltab,
.lnb_box .allmenu_sub .close,
.lnb_box .allmenu_sub .recent,
.lnb_box .allmenu_sub .service,
.lnb_box .allmenu_sub .genre>div>input {display: none;}

.lnb_box .lnb .allmenu_sub {
    width: 950px;
    height: 400px;
    border: 2px solid #333;
    background-color: white;
    border-top: 0;
    box-sizing: border-box;
    position: absolute;
    top: 43px;

    z-index: 6;
}
.lnb_box .lnb .allmenu_sub>section {
    width: 100%;
    height: 400px;
}
.lnb_box .lnb .allmenu_sub>section .genre {
    width: 100%;
    height: 400px;
}
.lnb_box .lnb .allmenu_sub>section .genre>div {
    width: 160px;
    height: 300px;
    margin-top: 28px;
    float: left;
}
.lnb_box .lnb .allmenu_sub>section .genre>div:first-child {
    margin-left: 115px;
}
.lnb_box .lnb .allmenu_sub>section .genre>div label {
    width: 160px;
    height: 40px;
    line-height: 40px;
    font-weight: bold;
    text-align: left;
    padding-bottom: 5px;
    color: black;
    cursor: default;
}

.lnb_box .lnb .allmenu_sub>section .genre>div label i {display: none;}

.lnb_box .lnb .allmenu_sub>section .genre>div>div>ul {
    width: 160px;
    height: auto;
}
.lnb_box .lnb .allmenu_sub>section .genre>div>div>ul>li {
    width: 160px;
    padding: 4px 0;
    font-size: 14px;
    padding-left: 1px;
}
.lnb_box .lnb .allmenu_sub>section .genre>div>div>ul>li:hover {
    text-decoration: underline;
    text-decoration-color: #333;
}



/*------------route-----------*/
.route {
    width: 950px;
    height: 30px;
    margin: 0 auto;
}
.route div {
    display: inline-block;
    height: 30px;
    line-height: 30px;
    font-size: 12px;
}
.route div:first-child {
    padding-left: 5px;
}
.route div select {
    border: none;
    font-size: 12px;
}


/*------------wrap-----------*/
.wrap {
    width: 950px;
    height: auto;

    margin: 0 auto;
    overflow: hidden;
}


/*------------contents01-----------*/
.wrap .contents01 {
    width: 950px;
    height: 560px
}
/*------------contents01 book_sort-----------*/
.wrap .contents01 .book_sort {
    width: 150px;
    height: 560px;
    border: 1px solid #ccc;
    box-sizing: border-box;
    background-color: white;
    margin-right: 10px;
    float: left;
}
.wrap .contents01 .book_sort p {
    font-size: 25px;
    font-weight: bold;
    margin-top: 10px;
    margin-left: 15px;
}
.wrap .contents01 .book_sort ul {
    margin-top: 20px;
    margin-left: 15px;
}
.wrap .contents01 .book_sort ul li {
    width: 150px;
    height: 30px;
    font-size: 15px;
}
.wrap .contents01 .book_sort ul li:hover {
    text-decoration: underline;
    text-decoration-color: #999;
}
.wrap .contents01 .book_sort .sort_ad {
    width: 120px;
    height: 100px;
    margin-left: 15px;
    margin-top: 70px;
}
.wrap .contents01 .book_sort .sort_ad img {
    width: 120px;
    height: 100px;
}

/*------------contents01 sub_two_box-----------*/
#subvisual01, #subvisual02, #subvisual03, #subvisual04 {display: none;}

#subvisual01:checked ~ .sub_visual_sheet .sub_sheet01 {display: block;}
#subvisual02:checked ~ .sub_visual_sheet .sub_sheet02 {display: block;}
#subvisual03:checked ~ .sub_visual_sheet .sub_sheet03 {display: block;}
#subvisual04:checked ~ .sub_visual_sheet .sub_sheet04 {display: block;}

#subvisual01:checked ~ .sub_visual_label .sub_label01 i {opacity: 1; color: salmon;}
#subvisual02:checked ~ .sub_visual_label .sub_label02 i {opacity: 1; color: salmon;}
#subvisual03:checked ~ .sub_visual_label .sub_label03 i {opacity: 1; color: salmon;}
#subvisual04:checked ~ .sub_visual_label .sub_label04 i {opacity: 1; color: salmon;}

#subvisual01:checked ~ .sub_visual_sheet ul li {transform: translateX(0);}
#subvisual02:checked ~ .sub_visual_sheet ul li {transform: translateX(-630px);}
#subvisual03:checked ~ .sub_visual_sheet ul li {transform: translateX(-1260px);}
#subvisual04:checked ~ .sub_visual_sheet ul li {transform: translateX(-1890px);}


.wrap .contents01 .sub_two_box {
    width: 790px;
    height: 560px;
    float: left;
}
.wrap .contents01 .sub_two_box .visual_ranking_box {
    width: 790px;
    height: 300px;
    margin-bottom: 10px;
    float: left;
}
.wrap .contents01 .sub_two_box .visual_ranking_box .sub_visual_banner {
    width: 630px;
    height: 300px;
    float: left;
    position: relative;
    
    margin-right: 10px;
    overflow: hidden;
}
.wrap .contents01 .sub_two_box .visual_ranking_box .sub_visual_banner .sub_visual_sheet {
    width: 630px;
    height: 300px;
}
.wrap .contents01 .sub_two_box .visual_ranking_box .sub_visual_banner .sub_visual_sheet ul {
    width: 2520px;
    height: 300px;
    float: left;
}
.wrap .contents01 .sub_two_box .visual_ranking_box .sub_visual_banner .sub_visual_sheet ul li {
    width: 630px;
    height: 300px;
    float: left;
}
.wrap .contents01 .sub_two_box .visual_ranking_box .sub_visual_banner .sub_visual_label {
    width: 200px;
    height: 20px;
    position: absolute;
    top: 250px;
    left: 235px;
    z-index: 1;
}
.wrap .contents01 .sub_two_box .visual_ranking_box .sub_visual_banner .sub_visual_label label {
    font-size: 50px;
    color: rgba(0, 0, 0, 0.2);
    cursor: pointer;
}
.wrap .contents01 .sub_two_box .visual_ranking_box .sub_visual_banner .sub_visual_sheet .sub_sheet01,
.wrap .contents01 .sub_two_box .visual_ranking_box .sub_visual_banner .sub_visual_sheet .sub_sheet02,
.wrap .contents01 .sub_two_box .visual_ranking_box .sub_visual_banner .sub_visual_sheet .sub_sheet03,
.wrap .contents01 .sub_two_box .visual_ranking_box .sub_visual_banner .sub_visual_sheet .sub_sheet04 {
    width: 630px;
    height: 300px;
    float: left;
}


.wrap .contents01 .sub_two_box .visual_ranking_box .sub_visual_banner .sub_visual_sheet:hover label {
    display: block;
}
.wrap .contents01 .sub_two_box .visual_ranking_box .sub_visual_banner .sub_visual_sheet li label {
    display: none;
}
.wrap .contents01 .sub_two_box .visual_ranking_box .sub_visual_banner .sub_visual_sheet label {
    display: block;
    position: absolute;
    top: 100px;
}
.wrap .contents01 .sub_two_box .visual_ranking_box .sub_visual_banner .sub_visual_sheet label i {
    width: 35px;
    height: 40px;
    line-height: 40px;
    background-color: rgba(0, 0, 0, 0.2);
    font-size: 20px;
    color: white;
    font-weight: bold;
    text-align: center;
}
.wrap .contents01 .sub_two_box .visual_ranking_box .sub_visual_banner .sub_visual_sheet label i:hover {
    background-color: rgba(0, 0, 0, 0.5);
    cursor: pointer;
}
.wrap .contents01 .sub_two_box .visual_ranking_box .sub_visual_banner .sub_visual_sheet .left {
    width: 35px;
    height: 40px;
    position: absolute;
    left: 0;
    top: 130px;
}
.wrap .contents01 .sub_two_box .visual_ranking_box .sub_visual_banner .sub_visual_sheet .right {
    width: 35px;
    height: 40px;
    position: absolute;
    right: 0;
    top: 130px;
}



/*---------ranking----------*/
#subtoday, #subweek {display: none;}
#subtoday:checked ~ .subranking .subsheet_today {display: block;}
#subweek:checked ~ .subranking .subsheet_week {display: block;}

#subtoday:checked ~ .subranking .subranking_label .label_today {border-bottom: none;}
#subweek:checked ~ .subranking .subranking_label .label_week {border-bottom: none;}

.subranking_box .subranking .subsheet_today,
.subranking_box .subranking .subsheet_week {
    display: none;
}


.wrap .contents01 .sub_two_box .visual_ranking_box .subranking_box {
    width: 150px;
    height: 300px;
    border: 1px solid #999;
    box-sizing: border-box;
    background-color: #969187;
    float: left;
    /* overflow: hidden; */
}
.wrap .contents01 .sub_two_box .visual_ranking_box .subranking_box .subranking_title {
    width: 150px;
    height: 30px;
    line-height: 30px;
    font-size: 14px;
    font-weight: bold;
    color: lemonchiffon;
    padding-left: 10px;
    float: left;
}
.wrap .contents01 .sub_two_box .visual_ranking_box .subranking_box .subranking {
    width: 150px;
    height: 270px;
    float: left;
}
.wrap .contents01 .sub_two_box .visual_ranking_box .subranking_box .subranking .subranking_label {
    width: 150px;
    height: 30px;
    float: left;
}
.wrap .contents01 .sub_two_box .visual_ranking_box .subranking_box .subranking .subranking_label label {
    width: 75px;
    height: 30px;
    line-height: 30px;
    text-align: center;
    border: 1px solid #666;
    border-left: none;
    box-sizing: border-box;
    font-size: 14px;
    color: #eee;
    float: left;
}
.wrap .contents01 .sub_two_box .visual_ranking_box .subranking_box .subranking .subranking_label label:hover {
    cursor: pointer;
}
.wrap .contents01 .sub_two_box .visual_ranking_box .subranking_box .subranking .subsheet_today {
    width: 150px;
    height: 240px;
    float: left;
}
.wrap .contents01 .sub_two_box .visual_ranking_box .subranking_box .subranking .subsheet_today ul,
.wrap .contents01 .sub_two_box .visual_ranking_box .subranking_box .subranking .subsheet_week ul {
    width: 140px;
    height: 240px;
    margin-left: 10px;
    margin-top: 10px;
}
.wrap .contents01 .sub_two_box .visual_ranking_box .subranking_box .subranking .subsheet_today ul li,
.wrap .contents01 .sub_two_box .visual_ranking_box .subranking_box .subranking .subsheet_week ul li {
    width: 120px;
    height: 22px;
    font-size: 12px;
    color: #eee;
    text-overflow: ellipsis;
    white-space: nowrap;
    overflow: hidden;
}
.wrap .contents01 .sub_two_box .visual_ranking_box .subranking_box .subranking .subsheet_today ul li a,
.wrap .contents01 .sub_two_box .visual_ranking_box .subranking_box .subranking .subsheet_week ul li a {
    padding-left: 10px;
    color: #eee;
}
.wrap .contents01 .sub_two_box .visual_ranking_box .subranking_box .subranking .subsheet_today ul li a:hover,
.wrap .contents01 .sub_two_box .visual_ranking_box .subranking_box .subranking .subsheet_week ul li a:hover {
    text-decoration: underline;
    text-decoration-color: #ccc;
}
.wrap .contents01 .sub_two_box .visual_ranking_box .subranking_box .subranking .subsheet_week {
    width: 140px;
    height: 240px;
    float: left;
}


/*------------wrap-----------*/
#yptab01, #yptab02, #yptab03, #yptab04 {display: none;}

#yptab01:checked ~ .yp_choice_sheet .yp_sheet01 {display: block;}
#yptab02:checked ~ .yp_choice_sheet .yp_sheet02 {display: block;}
